&lt;h1&gt;Developer Comment&lt;/h1&gt;
Screen reader accessible message for flight booking provider rating button. Including the score and number of reviews making that up, and that a summary modal dialog will open when pressed.

Placeholder for a numeric score value (e.g. 3.9) out of 5 and for a numeric count of how many reviews were submitted (e.g. 345).

